import { useQuery, gql } from '@apollo/client';

const getUser = gql`
    query getUser($id: String!) {
        user(id: $id) {
            id
            fname
            lname
        }
    }
`;
export default function Test() {

    const {loading, error, data} = useQuery(getUser, {
        variable: {id: '1'}
});
    return(
        <div>
            <p>Test</p>
            <p>{data.fname}</p>
        </div>
    )
}
